        const slider = document.getElementById('altSlider');
        const label  = document.getElementById('altLabel');
        const playBtn= document.getElementById('playBtn');
        const speed  = document.getElementById('speed');

        let playing = false;
        let timer = null;
        let current = 0;

        function hideAll(){
            layers.forEach(l => { if (l && mapObj.hasLayer(l)) mapObj.removeLayer(l); });
        }

        function setVisible(index){
            hideAll();
            const layer = layers[index];
            if (layer) mapObj.addLayer(layer);
            label.textContent = labels[index];
        }

        function firstValidIndex(){
            for (let i=0; i<layers.length; i++) if (layers[i]) return i;
            return 0;
        }

        slider.addEventListener('input', e => {
            current = parseInt(slider.value);
            setVisible(current);
        });

        function tick(){
            if (!playing) return;
            current = (current + 1) % labels.length;
            slider.value = current;
            setVisible(current);
        }

        playBtn.addEventListener('click', () => {
            playing = !playing;
            playBtn.textContent = playing ? '⏸ 停止' : '▶︎ 再生';
            if (playing) {
                timer && clearInterval(timer);
                timer = setInterval(tick, Math.max(50, parseInt(speed.value)||400));
            } else {
                timer && clearInterval(timer);
                timer = null;
            }
        });

        // 初期表示は最初に有効な層（マーカー）があるインデックス
        current = firstValidIndex();
        slider.value = current;
        setVisible(current);
    })();
